(1, 1, 1, 0, 0, 'Paket 1 no 1', '  <table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (1) Istilah generasi millennial memang sedang akrab terdengar di berbagai media. (2) Istilah tersebut berasal dari kata millennials yang diciptakan oleh dua pakar sejarah dan penulis Amerika, William Strauss dan NeilHowe dalam beberapa bukunya. (3)Millennialgeneration atau generasi Y juga akrab disebut generationme atau echoboomers.</p>\r\n\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (4) Secara harfiah, memang tidak ada demografi khusus dalam menentukan kelompok generasi yang satu ini. (5) Generasi ini tersebar di seluruh negara(6) Tapi, para pakar menggolongkannya berdasarkan tahun awal dan akhir. (7) Penggolongan generasi Y terbentuk bagi mereka yang lahir pada 1980-1990, atau pada awal 2000, dan seterusnya. (8) Awal 2016 Ericsson mengeluarkan 10 Tren Consumer Lab untuk memprediksi beragam keinginan konsumen.</p>\r\n\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (9) Dalam laporan tersebut Ericsson mencatat produk teknologi akan mengikuti gaya hidup masyarakat millennial. (10) Sebab, pergeseran perilaku turut berubah beriringan dengan teknologi. (11) Sepanjang tahun ini, beberapa prediksi yang disampaikan Ericsson berhasil terbukti. (12) Salah satunya, perilaku StreamingNative yang kini kian populer.</p>\r\n\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (13) Jumlah remaja yang mengonsumsi layanan streamingvideo kian tidak terbendung. (14) Ericsson mencatat, hingga 2011 silam hanya ada sekitar tujuh persen remaja berusia 16- 19 tahun yang menonton video melalui Youtube. (15) Rata-rata mereka menghabiskan waktu didepan layar perangkat gawai sekitar tiga jam sehari. (16) Angka tersebut melambung empat tahun kemudian menjadi 20 persen. (17) Waktu yang dialokasikan untuk menonton streaming juga meningkat tiga kali lipat. (18) Fakta tersebut membuktikan, perilaku generasi millennial sudah tidak bisa dilepaskan dari menonton video secara daring.</p>\r\n\r\n			<p style=\"text-align:right\">(dikutip dengan perubahan dari laman www.republika.co.id/berita/koran/inovasi/16/12/26/ois64613-mengenal-generasi-millennial)</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>  <p><strong>pertanyaan :</strong></p>  <p>Masalah utama dalam paragraf pertama adalah....</p> ', NULL, 'E', 5, '2'),
