(7, 1, 1, 0, 0, 'Paket 1 no 7', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (1) Ayunda Faza Maudya atau akrab disapa Maudy Ayunda, lahir di Jakarta pada 19 Desember 1994. (2) Ia mengawali karirnya pada tahun 2003 lewat dunia akting, yaitu dalam film berjudul &ldquo;Untuk Rena&rdquo; sebagai pemeran utama: Rena. (3) Setelah itu, berturut-turut membintangi berbagai film ternama seperti Sang Pemimpi (2006), Rumah Tanpa Jendela (2009), Tendangan dari Langit (2011), Malaikat Tanpa Sayap (2012), dan Perahu Kertas.</p>\r\n\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (4) Prestasinya, juga diakui oleh insan media tanah air. (5) Pada pertengahan tahun 2015, ia mendapat penghargaan NET Awards sebagai FemaleSingerof The Year-Indonesian ChoiceAwards. Dan di awal Oktober tahun 2017, ia mendapatkan 2 penghargaan sekaligus sebagai MostInfluentialMillenialof The Year dan Best Digital TalentInfluencer.</p>\r\n\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (6) Menyadari kecintaannya dalam bidang seni, bukan saja dalam dunia akting, Maudy pun mengeluarkan single perdananya, yakni &ldquo;Tiba-Tiba Cinta Datang&rdquo; lewat album &ldquo;Panggil Aku&rdquo; pada tahun 2011. (7) Selain piawai berakting dan bernyanyi, Maudy Ayunda juga dikenal sebagai sosok yang cerdas. (8) Saat ini ia adalah salah satu dari sedikit orang Indonesia yang diterima untuk dapat melanjutkan studi di Universitas Oxford, Inggris. (9) Pada waktu senggangnya, ia juga memiliki hobi menulis. (10) Pada usia 10 tahun, ia pernah membuat buku kumpulan dongeng anak berjudul a ForestofFables dan semua hasil penjualannya disumbangkan untuk korban tsunami Aceh.</p>\r\n\r\n			<p style=\"text-align:right\"><em>(Dikutip dengan perubahan dari laman http://www.trinityproduction.com)</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>  <p><strong>pertanyaan :</strong></p>  <p>Berdasarkan teks tersebut, keistimewaan tokoh Maudy Ayunda adalah....</p> ', NULL, 'E', 5, '2'),
(8, 1, 1, 0, 0, 'Paket 1 no 8', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (1) Ayunda Faza Maudya atau akrab disapa Maudy Ayunda, lahir di Jakarta pada 19 Desember 1994. (2) Ia mengawali karirnya pada tahun 2003 lewat dunia akting, yaitu dalam film berjudul &ldquo;Untuk Rena&rdquo; sebagai pemeran utama: Rena. (3) Setelah itu, berturut-turut membintangi berbagai film ternama seperti Sang Pemimpi (2006), Rumah Tanpa Jendela (2009), Tendangan dari Langit (2011), Malaikat Tanpa Sayap (2012), dan Perahu Kertas.</p>\r\n\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (4) Prestasinya, juga diakui oleh insan media tanah air. (5) Pada pertengahan tahun 2015, ia mendapat penghargaan NET Awards sebagai FemaleSingerof The Year-Indonesian ChoiceAwards. Dan di awal Oktober tahun 2017, ia mendapatkan 2 penghargaan sekaligus sebagai MostInfluentialMillenialof The Year dan Best Digital TalentInfluencer.</p>\r\n\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (6) Menyadari kecintaannya dalam bidang seni, bukan saja dalam dunia akting, Maudy pun mengeluarkan single perdananya, yakni &ldquo;Tiba-Tiba Cinta Datang&rdquo; lewat album &ldquo;Panggil Aku&rdquo; pada tahun 2011. (7) Selain piawai berakting dan bernyanyi, Maudy Ayunda juga dikenal sebagai sosok yang cerdas. (8) Saat ini ia adalah salah satu dari sedikit orang Indonesia yang diterima untuk dapat melanjutkan studi di Universitas Oxford, Inggris. (9) Pada waktu senggangnya, ia juga memiliki hobi menulis. (10) Pada usia 10 tahun, ia pernah membuat buku kumpulan dongeng anak berjudul a ForestofFables dan semua hasil penjualannya disumbangkan untuk korban tsunami Aceh.</p>\r\n\r\n			<p style=\"text-align:right\"><em>(Dikutip dengan perubahan dari laman http://www.trinityproduction.com)</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table><p><strong>pertanyaan :</strong></p>  <p>Pernyataan berikut berkaitan dengan keteladanan tokoh, yakni...</p> ', NULL, 'E', 5, '2'),
