strong></p>  <p>Kalimat (9) dapat divariasikan ke dalam kalimat berikut, kecuali....</p> ', NULL, 'D', 5, '2'),
(11, 1, 1, 0, 0, 'Paket 1 no 11', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align:center\"><strong>Solusi Pemprov DKI atasi Polusi</strong><br />\r\n			oleh Anindhita Maharrani</p>\r\n\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Polusi udara pada ibu kota sedang menjadi topik hangat. Sebagai salah satu upaya mengatasinya, pemerintah provinsi (Pemprov) DKI Jakarta berencana menambah alat ukur kualitas udara yang seperti namanya hanya bisa mengukur kualitas udara, bukan memperbaikinya. Saat ini, Jakarta punya delapan alat pengukur kualitas udara. Lima alat permanen terpasang di Bundaran HI (Jakarta Pusat), Jagakarsa (Jakarta Selatan), Lubang Buaya (Jakarta Timur), dan Kebon Jeruk (Jakarta Barat). Tiga lainnya versi mobile, biasanya digunakan saat ada perhelatan seperti carfreeday. Namun, di situs Jakarta Smart City, alat ukur tersebut tidak menampilkan kadar PM2,5. Hanya ada PM10, So2, CO, O3, dan NO2.</p>\r\n\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tahun 2019, akan ada dua alat tambahan. Keduanya bisa mengukur polutan PM2,5 (particulatematter) yang berbahaya. Dan, juga mengukur kadar PM10, So2, NO, CO, dan Ozon. &quot;Ada 2 (yang ditambah) kalau enggak salah. Pakai APBD (Anggaran Pendapatan dan Belanja Daerah) sekarang ada. Nanti 2020 ditambah lagi,&quot; kata Kepala Dinas Lingkungan Hidup DKI Jakarta, Andono Warih, Senin (8/7/2019). Alat pengukur kualitas udara dengan fitur ini dibanderol Rp5 milyar per set. Menurut Andono, itu harga beberapa tahun lalu. Kelak, Pemprov DKI akan menambah delapan alat lagi pada 2020. Meski alat ini hanya bisa mengukur kualitas udara, bukan mengurangi polusi.</p>\r\n\r\n			<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Andono menjelaskan, menentukan berapa tool yang dibutuhkan juga dilakukan melaluilewat riset. Ada dua pendekatan yang digunakan. Pertama berdasarkan jumlah penduduk. Kedua menurutradius atau luas wilayah. &quot;Ada riset yang dilakukan baik dari luar maupun Pemprov DKI. Ada beberapa pendekatan misalnya per 1 juta penduduk 1 alat. Kita kan ada 13-an juta penduduk, jadi 13Tangkapan layar indeks standar pencemaran udara di DKI Jakarta dari Jakarta Smart City.&rdquo;Sementara menurut radius atau luas wilayah, Jakarta yang kata Andonomempunyai luas sekitar 650 kilometer persegi butuh sekitar 25 alat yang bisa mengukur kualitas udara termasuk PM2,5.</p>\r\n\r\n			<p style=\"text-align:right\"><em>(Dikutip dengan perubahan dari laman Beritagar.id, 9 Juli 2019)</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table><p><strong>pertanyaan :</strong></p>  <p>Berikut ini beberapa makna polusi dalam berita di atas, <strong>kecuali...</strong></p> ', NULL, 'C', 5, '2'),
