(21, 1, 1, 0, 0, 'Paket 1 no 21', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Untuk esports, streaming berfungsi membantu mengaktifkan turnamen besar untuk bisa melibatkan masyarakat umum, dan memperluas jangkauan secara signifikan. Untuk para penggemar esports, streaming ternyata memberikan tingkat kenyamanan yang lebih tinggi bila dibandingkan dengan datang langsung. Para penggemar esports dapat menikmati serunya pertandingan langsung dari kamar tidur mereka dengan hanya bermodalkan sebuah perangkat PC/Laptop/telepon seluler dan koneksi sekitar 5Mbps, platform situs streaming seperti YouTube, Twitch dan lainnya.</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Keuntungan lainnya juga dirasakan bagi para pengisi konten (streamer). Mereka yang berhasil dalam streaming dan memiliki banyak penonton bisa mendapatkan uang yang cukup fantastis dari melakukan streaming saja. Memang, hal itu tidak semudah seperti menekan tombol record dan kemudian memiliki sekian ribu penonton. Para streamer membutuhkan waktu yang cukup lama untuk membangun fanbase mereka terlebih dahulu. Lalu, para streamer akan bergerak dengan mempromosikan fanbase mereka. Para streamer kemudian berkolaborasi dengan beberapa platform untuk bisa menghasilkan uang.</p>\r\n\r\n			<p style=\"text-align:right\"><em>(dikutip dalam laman Esportsnesia.com)</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table><p><strong>Pertanyaan :</strong></p>  <p>Hubungan paragraf pertama dan kedua adalah ....</p>', NULL, 'E', 5, '2');
INSERT INTO `bank_soals` (`id`, `tingkat_id`, `matpel_id`, `type_soal`, `jenis_soal`, `lable`, `soal`, `keterangan`, `jawaban`, `jlm_jawaban`, `skor_soal`) VALUES
(22, 1, 1, 0, 0, 'Paket 1 no 22', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Untuk esports, streaming berfungsi membantu mengaktifkan turnamen besar untuk bisa melibatkan masyarakat umum, dan memperluas jangkauan secara signifikan. Untuk para penggemar esports, streaming ternyata memberikan tingkat kenyamanan yang lebih tinggi bila dibandingkan dengan datang langsung. Para penggemar esports dapat menikmati serunya pertandingan langsung dari kamar tidur mereka dengan hanya bermodalkan sebuah perangkat PC/Laptop/telepon seluler dan koneksi sekitar 5Mbps, platform situs streaming seperti YouTube, Twitch dan lainnya.</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Keuntungan lainnya juga dirasakan bagi para pengisi konten (streamer). Mereka yang berhasil dalam streaming dan memiliki banyak penonton bisa mendapatkan uang yang cukup fantastis dari melakukan streaming saja. Memang, hal itu tidak semudah seperti menekan tombol record dan kemudian memiliki sekian ribu penonton. Para streamer membutuhkan waktu yang cukup lama untuk membangun fanbase mereka terlebih dahulu. Lalu, para streamer akan bergerak dengan mempromosikan fanbase mereka. Para streamer kemudian berkolaborasi dengan beberapa platform untuk bisa menghasilkan uang.</p>\r\n\r\n			<p style=\"text-align:right\"><em>(dikutip dalam laman Esportsnesia.com)</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table><p><strong>Pertanyaan :</strong></p>  <p>Makna platform dalam bacaan di atas mengandung arti....</p> ', NULL, 'E', 5, '2'),
(23, 1, 1, 0, 0, 'Paket 1 no 23', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (1) Ekosistem esports telah berhasil menarik perhatian dunia dengan sedikit campur tangan dari pemerintah, hukum, atau pun pengawasan internal. (2) Seiring dengan meningkatnya jumlah audiens dan peluang monetisasi, kebutuhan akan koordinasi dan kerja sama antar pemangku kepentingan pun turut meningkat. (3) Organisasi tim esports, baik yang dengan atau tanpa modal besar, terus berupaya mencapai kondisi keuangan yang berkelanjutan dan jangka panjang, yang saat ini hanya berpotensi dicapai melalui bantuan dana dari pemerintah dan subsidi-subsidi.</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (4) Demikian juga, beberapa Pemerintah lokal dan nasional sekarang mulai melihat esports sebagai katalis untuk mendorong pertumbuhan ekonomi dan pariwisata. (5) Mereka juga akan mulai mengadakan turnamen nasional mereka sendiri atau mencari cara untuk dapat menjadi tuan rumah dari suatu turnamen internasional. (6) Pertanyaannya sekarang adalah apakah para pemangku kepentingan esports akan secara aktif mencari dukungan pemerintah, atau apakah pemerintah yang akan memberikannya terlebih dahulu?</p>\r\n\r\n			<p style=\"text-align:right\"><em>(Dikutip dengan perubahan dari laman https://esportsnesia.com/fokus/pengaruh-politik-esports/)</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table><p><strong>Pertanyaan :</strong></p>  <p>Dalam paragraf pertama terdapat kesalahan ejaan sebagai berikut, kecuali...</p> ', NULL, 'C', 5, '2'),
