(35, 1, 1, 0, 0, 'Paket 1 no 35', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align:center\">&ldquo;Film Nasional Versus Bioskop&rdquo;<br />\r\n			oleh A Rahim Latif</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Menjelang perayaan Hari Jadi Ke-65 Film Nasional pada 30 Maret 2015, sejumlah budayawan dan sutradara/produser film Tanah Air mencemaskan kondisi perfilman kita akibat perilaku sekelompok bioskop yang dinilai diskriminatif, tidak etis. Tampaknya Garin Nugroho kini sudah &rdquo;dewasa&rdquo;. Dia mengklaim film nasional yang masih ada penontonnya diturunkan/dicabut pemutarannya oleh pihak bioskop dengan semena-mena, sementara film impor Hollywood terus diputar walau sudah tidak ada penonton. Perilaku tidak fair ini membuat Garin memohon Presiden Joko Widodo segera turun tangan membenahi ketimpangan-ketimpangan dalam pengelolaan perfilman kita.</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Adapun Slamet Rahardjo Djarot meminta perhatian Presiden saat menerima penghargaan Pencapaian Seumur Hidup pada FFI 2015 di Palembang. Untuk pertama kalinya mendapat kehormatan dihadiri oleh Presiden RI.</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sineas sekaliber Garin Nugroho dan Slamet Rahardjo sungguh sadar bahwa seni film adalah flagcarriernya kebudayaan bangsa. Mereka berhak sepenuhnya untuk menancapkan bendera kebudayaan itu di setiap jengkal tanah bumi pertiwi. Maka, apabila ada bioskop atau kelompok bioskop yang menghalangi, melecehkan, bahkan sampai menolak penancapan bendera tersebut di bumi tempat bioskop itu berpijak, apakah ini tidak merupakan keangkuhan dan suatu kesalahan besar?</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hans Gunadi, PresidentDirectorCinema 21, disertai CorporateCinema 21 Catherine Keng berkunjung ke kantor Redaksi Kompas di Jakarta pada Selasa (7/4). Pada kesempatan itu Hans menyatakan bahwa film dalam negeri tetap mendapatkan tempat untuk diputar di bioskop-bioskop Cinema 21 karena hal itu merupakan komitmen Cinema 21 untuk memajukan perfilman Indonesia. Benarkah? Simaklah beberapa dari sekian fakta yang kontradiktif berikut ini: hingga sekitar sepuluh tahun lalu bioskop Blok M Plaza 21 sudah menjadi sangat potensial bagi film nasional. Bahkan, pernah terjadi seluruh enam layarnya memutar hanya film nasional. Namun, itu tak pernah terjadi lagi dan mayoritas film yang diputar di bioskop tersebut adalah film impor saja. Mengapa?</p>\r\n\r\n			<p style=\"text-align:right\"><em>(dimuat Kompas, 2/8/2015, ditayangkan ulang oleh http://filmindonesia.or.id/article/kajian)</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table><p><strong>Pertanyaan :</strong></p>  <p>Berikut ini gambaran film nasional berdasarkan teks di atas....</p> ', NULL, 'A', 5, '2'),
(36, 1, 1, 0, 0, 'Paket 1 no 36', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">  <tbody>   <tr>    <td>I</td>    <td>Ini adalah kali ketiga aku merayakan lebaran di negeri orang. Bahagia, rindu, sedih, bercampur menjadi satu. Tak ada suara takbir, tak ada ketupat, apalagi jajanan di dalam toples. Yang ada hanya nelangsa menjelma di dalam atma saat rindu mulai berkuasa karena sudah tiga kali lebaran aku tidak bisa berkumpul dengan emak, serta kedua adikku. Tak ubahnya seperti hari-hari biasanya, aku tetap bergelut dengan rutinitas yang telah menanti.</td>   </tr>   <tr>    <td>II</td>    <td>&ldquo;Nenek, yuk berangkat ke taman, mumpung matahari belum terlalu panas,&rdquo; ajakku pada nenek yang kurawat. &ldquo;Aku tidak mau!&rdquo; Jawabnya seraya menarik kembali selimut agar tubuhnya yang telah keriput tidak terendus sinar matahari.</td>   </tr>   <tr>    <td>III</td>    <td>Begitulah nenek, manjanya luar biasa. Terkadang tingkahnya seperti balita, ingin dirayu acapkali mengurusnya. Anak-anak, serta semua cucunya selalu sibuk dengan urusan masing- masing. Itulah yang membuat ia kesepian. Hari-hari tuanya hanya dihabiskan denganku, yang bertugas sebagai perawat, sekaligus teman dalam bercanda.</td>   </tr>  </tbody> </table>  <p style=\"text-align:right\">(Dikutip dari &ldquo;Lebaran di Perantauan&rdquo; karya Etik Nurhalimah)</p>  <p><strong>Pertanyaan : </strong></p>  <p>Tokoh Nenek dalam bagian III teks di atas digambarkan pengarang melalui....</p> ', NULL, 'B', 5, '2'),
