(39, 1, 1, 0, 0, 'Paket 1 no 39', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>&nbsp; &ldquo;Minal &lsquo;Aidhinwal Faizin, Mak. Mohon maaf lahir dan batin.&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Iya, sama-sama, Nduk. Mamak juga minta maaf ya karena selalu merepotkanmu. Bahkan sekarang emak dan adik-adik bergantung hidup padamu,&rdquo; suara emak terdengar parau di seberang sana.</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Aku tahu emak tengah menahan tangis yang tak berani ia tumpahkan.</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Bagaimana kabar emak dan adik-adik sekarang?&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Emak baik, Nduk. Adikmu Yanto sudah masuk SMP, sedangkan Tatik sekarang kelas empat SD.&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kesedihanku seolah menguap begitu saja, seiring mendengar orang-orang yang kusayangi dalam keadaan bahagia dan hidup layak seperti orang lain. Pergi ke sekolah, bermain dan membaur dengan anak-anak sebaya mereka. Bisa memberi jajanan dan permen saat di sekolahan. Tidak seperti kehidupanku dahulu, yang hanya tahu bagaimana mengambil jagung yang bekas dipanen orang. Jagung-jagung tersebut kami bawa pulang untuk dijual atau diolah menajadi nasi. Disantap bersama sambel tumpeng buatan emak, yang sekarang menjadi makan idaman yang ingin kunikmati.</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Ah... Emak, rasanya aku ingin sekali menikmati masakan olahan tanganmu.&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:right\"><em>(Dikutip dari &ldquo;Lebaran di Perantauan&rdquo; karya Etik Nurhalimah)</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table><p><strong>Pertanyaan : </strong></p>  <p>Konflik yang terjadi dalam teks di atas adalah....</p> ', NULL, 'E', 5, '2'),
