(41, 1, 1, 0, 0, 'Paket 1 no 41', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">  <tbody>   <tr>    <td>Gadis peminta-minta<br />    karya Toto Sudarto Bahtiar<br />    (1) Setiap kita bertemu, gadis kecil berkaleng kecil<br />    (2) Senyummu terlalu kekal untuk kenal duka<br />    (3) Tengadah padaku, pada bulan merah jambu<br />    (4) Tapi kotaku jadi hilang, tanpa jiwa<br />    ...<br />    (5) Kalau kau mati, gadis kecil berkaleng kecil<br />    (6) Bulan di atas itu tak ada yang punya<br />    (7) Dan kotaku, ah kotaku<br />    (8) Hidupnya tak lagi punya tanda</td>   </tr>  </tbody> </table>  <p><strong>Pertanyaan : </strong></p>  <p>Larik bermajas dalam kutipan puisi di atas adalah sebagai berikut, kecuali....</p> ', NULL, 'E', 5, '2'),
