(46, 1, 1, 0, 0, 'Paket 1 no 46', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>&ldquo;Mas ini wartawan, ya?&rdquo; sapa ramah seorang pemuda yang sama-sama sedang menghadap cangkir kopi. Wajahnya segar dan riang. Seperti itu juga paras ibu pemilik warung. Seperti bercahaya.</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dadang menggeleng. Dihirupnya aroma kopi sebelum hati-hati meminumnya. Ia sodorkan bungkusan rokok. Pemuda gundul membalasnya dengan senyuman. Tampak sungkan menarik sebatang rokok.</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Saya cuma kuli, Dik. Kebetulan ada kerjaan di sini.&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Kuli kok kayak mau pelesiran begini, Mas. Baru kali ini ke Kota Owah?&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &amp;Kali ini Dadang mengangguk. Sambil bercakap Dadang sesekali melihat cahaya-cahaya dari bangunan yang terbalut kabut tipis. Begitu rapi. Rumah-rumah berjajar, tenteram, dan lelap. Jalanan lebar. Trotoar terbebas dari sampah. Di pertigaan samar terlihat sebuah patung dalam kucuran air mancur dan lampu warna-warni.</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Memotret pengemis di kota ini?&rdquo; Ari, begitu nama pemuda gundul yang ternyata tukang ojek, seakan tersentak. Heran.</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Kenapa?&rdquo; Dadang teringat reaksi istrinya ketika ia mengatakan hal yang sama.</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Heran saja. Kok pas sekali. Ini kan musimnya pengemis di sini. Kok milih kota ini, Mas? Di kota-kota lain juga pasti banyak.&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Musim pengemis?&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Lebih tepatnya pesta pengemis.&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Hahaha! Menarik ini. Pantas Murtopo menyuruhku langsung berangkat.&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Murtopo? Murtopo yang pelukis itu? Pelukis yang melulu melukis pengemis?&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Lho?&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Siapa tak kenal Murtopo di kota ini, Mas. Dia pahlawan bagi kami. Tak ada tokoh yang paling dibanggakan selain Murtopo. Dia mengharumkan nama Kota Owah sampai ke luar negeri. Konon, dia juga yang paling rajin menyumbang untuk pembangunan. Dia panutan di kota ini, Mas. Di sini, ada banyak bayi yang lahir diberi nama Murtopo.&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Anak saya juga saya namai Murtopo agar bisa tangguh dan ampuh seperti dia.&rdquo; Timpal ibu pemilik warung kopi yang dari tadi tampak seperti memejamkan mata. &ldquo;Sialan Murtopo!&rdquo; batin Dadang sedikit iri. Diteguknya sisa kopi sampai habis. &ldquo;Sumpahnya itu lho, Mas, yang sangat terkenal. Anak-anak kecil juga menghafalnya sambil bermimpi bisa seberani itu.&rdquo;</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;Sumpah? Murtopo punya sumpah?!&rdquo; Dadang tak jadi menyulut rokok.</em></p>\r\n\r\n			<p style=\"text-align:justify\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mas ini benar kawannya? Masa, tidak tahu. Sumpah yang ini,&rdquo; Ari mendadak berdiri di atas kursi, ibu pemilik warung juga ikut berdiri, mereka mengangkat tangan kiri, serempak berkata. &rdquo;Sekali pergi meninggalkan kampung halaman pantang pulang sebelum mati.&rdquo;</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table> <p><strong>Pertanyaan : </strong></p>  <p>Apa yang diperbincangkan dalam kutipan drama di atas....</p> ', NULL, 'D', 5, '2'),
