(49, 1, 1, 0, 0, 'Paket 1 no 49', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">  <tbody>   <tr>    <td>Banyak orang-orang amat bangga sekali atas keberhasilan para atlitindonesia</td>   </tr>  </tbody> </table>  <p><strong>Pertanyaan : </strong></p>  <p>Perbaikan kalimat yang benar untuk kutipan di atas adalah....</p> ', NULL, 'E', 5, '2');
