(50, 1, 1, 0, 0, 'Paket 1 no 50', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">  <tbody>   <tr>    <td>Segala cara telah dicoba, baik cara persuasif, negosiasi, ataupun militansi.</td>   </tr>  </tbody> </table>  <p><strong>Pertanyaan : </strong></p>  <p>Perbaikan konjungsi yang tepat untuk kutipan kalimat di atas adalah....</p> ', NULL, 'D', 5, '2'),
(88, 1, 7, 0, 0, 'Paket 1 no 1', '<p>Bapak Zenal adalah seorang penjual kue, pada saat ini beliau mengalami permasalahan keterlabatan distribusi akibat sering terjebak macet saat di jalan. Berdasarkan keterangan di atas, masalah ekonomi apa yang dihadapi Bapak Zenal?</p> ', NULL, 'E', 5, '2.5'),
(89, 1, 7, 0, 0, 'Paket 1 no 2', '<p>Budi adalah seorang lulusan SMK, di ditawari bekerja di bengkel dengan gaji Rp1.000.000,- setiap bulannya. Bertepatan dengan itu ia juga di tawari bekerja membantu pamannya dengan gaji Rp1.200.000,- setiap bulannya. Tapi Budi memilih untuk melanjutkan pendidikannya di luar kota dengan biaya Rp2.000.000,- per bulannya. Dari pernyataan tersebut berapa biaya pelang yang ia korbankan karena tidak memilih kesempatan untuk bekerja?</p> ', NULL, 'B', 5, '2.5'),
(90, 1, 7, 0, 0, 'Paket 1 no 3', '<p>Perhatikan Tabel di bawah ini!</p>  <table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">  <tbody>   <tr>    <td>A1. Kemudahan bagi pemerintah untuk mengendalikan masalah ekonomi</td>    <td>B1. Individualitas dan kepentingan bersama</td>    <td>C1. Sumber kekayaan didapat dari pemberdayaan tenaga kerja</td>   </tr>   <tr>    <td>A2. Kebebasan atas hak milik individu</td>    <td>B2. Distribusi pendapatan merata</td>    <td>C2. Produksi dan pasar dibawah kendali pemerintah</td>   </tr>   <tr>    <td>A3. Alat pemenuh kebutuhan terbatas</td>    <td>B3. Tindakan ekonomi diarahkan pada efisiensi dan efektivitas</td>    <td>C3. Untuk kemakmuran rakyat</td>   </tr>  </tbody> </table>  <p>Dari tabel diatas, manakah yang termasuk kelebihan sistem ekonomi komando?</p> ', NULL, 'A', 5, '2.5'),
(91, 1, 7, 0, 0, 'Paket 1 no 4', '<p>Uni adalah salah satu pengusaha restoran di Padang, restorannya terkenal dan banyak dikunjungi turis lokal maupun asing. Melihat kesempatan tersebut Uni berencana membuka cabang restorannya di daerah lain. Hal yang dilakukan Uni dalam memperluas produksinya adalah...</p> ', NULL, 'E', 5, '2.5'),
(92, 1, 7, 0, 0, 'Paket 1 no 5', '<p>Jika diketahui biaya untuk membuat barang adalah 200 per unit, dan biaya pembelian alat pembuat nya adalah 1200, maka biaya variabel untuk pembuatan barang tersebut adalah...</p> ', NULL, 'C', 5, '2.5'),
(93, 1, 7, 0, 0, 'Paket 1 no 6', '<p>Kurva yang menunjukan kombinasi barang yang dikonsumsi pada pendapatan yang sama adalah kurva...</p> ', NULL, 'C', 5, '2.5'),
(94, 1, 7, 0, 0, 'Paket 1 no 7', '<p>Faktor yang mempengaruhi permintaan:</p>  <ol>  <li>Harga barang tersebut</li>  <li>Harga barang substitusi</li>  <li>Harga barang komplementer</li>  <li>Pendapatan</li>  <li>Selera</li> </ol>  <p>Dari beberapa faktor permintaan, manakah yang akan menggerakan kurva permintaan?</p> ', NULL, 'D', 5, '2.5'),
(95, 1, 7, 0, 0, 'Paket 1 no 8', '<p>Perhatikan Tabel di bawah ini!</p>  <table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">  <tbody>   <tr>    <td style=\"text-align:center\"><strong>Harga (Rp)</strong></td>    <td style=\"text-align:center\"><strong>Permintaan (Unit)</strong></td>    <td style=\"text-align:center\"><strong>Penawaran (unit)</strong></td>   </tr>   <tr>    <td style=\"text-align:center\">5.000</td>    <td style=\"text-align:center\">10</td>    <td style=\"text-align:center\">20</td>   </tr>   <tr>    <td style=\"text-align:center\">7.000</td>    <td style=\"text-align:center\">12</td>    <td style=\"text-align:center\">18</td>   </tr>   <tr>    <td style=\"text-align:center\">9.000</td>    <td style=\"text-align:center\">14</td>    <td style=\"text-align:center\">14</td>   </tr>   <tr>    <td style=\"text-align:center\">11.000</td>    <td style=\"text-align:center\">15</td>    <td style=\"text-align:center\">10</td>   </tr>   <tr>    <td style=\"text-align:center\">13.000</td>    <td style=\"text-align:center\">17</td>    <td style=\"text-align:center\">8</td>   </tr>  </tbody> </table>  <p>Menurut tabel di atas berapakah harga kesepakatan yang tebentuk?</p> ', NULL, 'C', 5, '2.5'),
(96, 1, 7, 0, 0, 'Paket 1 no 9', '<p>Jika harga kebutuhan barang pokok tinggi, bagaimana dampak terhadap total pendapatan penjualnya?</p> ', NULL, 'A', 5, '2.5'),
