(105, 1, 7, 0, 0, 'Paket 1 no 19', '<p>Perhatikan cuplikan berita di bawah ini!</p>  <table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">  <tbody>   <tr>    <td>    <p>....Arus urbanisasi yang tidak dikendalikan setelah periode Lebaran dapat menambah beban terhadap kota-kota besar, seperti masalah penggangguran.</p>     <p><br />    Oleh karena itu, pengamat kebijakan publik Trubus Rahardiansyah berpandangan pemerintah daerah asal diharapkan melakukan sejumlah strategi solutif.</p>     <p><br />    Di Jakarta misalnya, jumlah pendatang baru pada 2019 diperkirakan mencapai 71.737 orang, meningkat dari 2018 sebesar 69.479 orang dan 2017 sejumlah 70.752 orang. Trubus, pengamat kebijakan publik dari Universitas Trisakti Jakarta, menilai peniadaan operasi yustisi menjadi polemik karena seperti membebaskan setiap WNI untuk datang ke Ibu Kota. Masalahnya, hal itu belum dibarengi strategi untuk mengatasi penambahan beban di Jakarta.</p>     <p><br />    &ldquo;Kalau pendatang yang masuk belum memiliki keahlian, lokasi kerja atau tempat tinggal belum jelas, ini menambah beban Jakarta. Pengangguran juga menciptakan kerawanan sosial,&rdquo; tuturnya.</p>     <p><br />    Sumber: https://kabar24.bisnis.com/read/20190617/15/934353/antisipasi-urbanisasi-pemerintah- daerah-asal-harus-berperan</p>    </td>   </tr>  </tbody> </table>  <p>Pengangguran merupakan masalah utama dalam ketenagakerjaan di berbagai negara. Oleh karena itu, diperlukan kebijakan dari pemerintah untuk menanggulangi masalah tersebut. Berdasarkan berita di atas, kebijakan pemerintah yang tepat untuk mengatasi masalah pengangguran di Ibu Kota adalah...</p> ', NULL, 'C', 5, '2.5'),
(106, 1, 7, 0, 0, 'Paket 1 no 20', '<p>Perhatikan berita di bawah ini!</p>  <table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">  <tbody>   <tr>    <td>    <p>...Seperti tahun-tahun sebelumnya, inflasi Lebaran kali ini lebih tinggi jika dibandingkan dengan bulan-bulan biasa. Namun, angkanya tidak terlalu jauh berbeda dengan yang lalu. Harga komoditas menjadi faktor utama yang memicu tingginya inflasi. Tepatnya harga cabai, bawang putih, dan bawang merah. Meski begitu, inflasi tahun ini tidak melampaui target pemerintah.</p>     <p>Berdasar data Pusat Informasi Harga Pangan Strategis Nasional (PIHPS), harga rata-rata cabai merah pada akhir Mei berkisar Rp 44 ribu per kilogram. Harga tersebut naik menjadi Rp 57.950 per kilogram pada 3 Juni dan naik lagi menjadi Rp 63.500 per kilogram per 4 Juni.</p>     <p>Sumber: https://www.jawapos.com/ekonomi/bisnis/08/06/2019/terkerek-harga-cabai-dan-bawang- inflasi-lebaran-tinggi/</p>    </td>   </tr>  </tbody> </table>  <p>Inflasi yang terjadi berdasarkan berita di atas disebabkan karena...</p> ', NULL, 'A', 5, '2.5'),
