(126, 1, 7, 1, 1, 'Paket 1 no 27', '<p>18 juli 2019 Pa Burhan akan mendirikan usaha, sebagai modal awal. Ia menyetorkan uang Rp150.000.000,- dan 3 unit mobil seharga Rp600.000.000,-. Bagaimanakah pencatatan kedalam persamaan dasar akuntansinya?</p>', NULL, 'A', 5, '2.5'),
(127, 1, 7, 1, 1, 'Paket 1 no 35', '<p>1 Juli 2020 dibeli barang dagang dari Toko Wahyu seharga Rp5.000.000,- dengan syarat 3/10, n/30, no Faktor 01. Bagaimana pencatatan transakasi di atas ke dalam jurnal pembelian?</p>', NULL, 'A', 5, '2.5'),
(128, 1, 6, 0, 0, 'Paket 1 no 1', '<p>Gunakan kaidah angka penting untuk menghitung 3,2 &times; 2,7 = ..</p> ', NULL, 'B', 5, '2.5'),
(129, 1, 6, 0, 0, 'Paket 1 no 2', '<p>Gunakan kaidah angka penting untuk menghitung 1,513 + 27,3 = ...</p> ', NULL, 'C', 5, '2.5'),
(130, 1, 6, 0, 0, 'Paket 1 no 3', '<p>Pada selang waktu yang pendek diketahui besarnya kecepatan suatu benda bergantung waktu dapat dinyatakan <em>v = at <sup>2</sup> + bt 3</em> , dengan <em>v</em> (m/s) dan waktu <em>t </em>dalam sekon. Tentukan satuan untuk <em>a</em> dan <em>b</em> secara berurutan</p> ', NULL, 'D', 5, '2.5'),
(131, 1, 6, 0, 0, 'Paket 1 no 4', '<p>Mobil bergerak sejauh 40 km dengan laju rata-rata 80 km/jam, dan kemudian bergerak lagi sejauh 40 km dengan laju rata-rata 40 km/jam. Tentukan berapa laju rata-rata dari mobil tersebut untuk total jarak tempuh 80 km</p> ', NULL, 'D', 5, '2.5'),
(132, 1, 6, 0, 0, 'Paket 1 no 5', '<p>Posisi suatu objek diberikan oleh fungsi <em>x = 7t &ndash; 3t <sup>2</sup></em> , dengan <em>x </em>dalam meter dan <em>t</em> dalam sekon. Hitunglah kecepatan rata-rata pada selang waktu dari <em>t = 0</em> ke <em>t = 2</em> sekon.</p> ', NULL, 'B', 5, '2.5'),
(133, 1, 6, 0, 0, 'Paket 1 no 6', '<p>Dua vektor <u>A</u> dan <u>B</u> terletak pada bidang xy. Kita dapat simpulkan bahwa&nbsp; <u>A</u> = <u>B</u> jika ...</p> ', NULL, 'C', 5, '2.5'),
(134, 1, 6, 0, 0, 'Paket 1 no 12', '<p>Jika ada 2 benda berbeda massanya <em>m</em> dan yang lainnya 2m, keduanya bergerak sepanjang lintasan berbentuk lingkaran dengan jari-jari 1.0 m, dan bergerak dengan besarnya laju yang sama 1.0 m/s. Bagaimanakah besarnya percepatan kedua benda tersebut:</p> ', NULL, 'A', 5, '2.5'),
(135, 1, 6, 0, 0, 'Paket 1 no 13', '<p>Manakah dari kombinasi besarnya massa dan laju yang dimiliki suatu benda, yang memberikan nilai energi kinetiknya terbesar.</p> ', NULL, 'C', 5, '2.5'),
(136, 1, 6, 0, 0, 'Paket 1 no 21', '<p>Konduktor A berupa kabel pejal berdiameter 1 m. Konduktor B silinder berongga dengan diameter terdalamnya 1 m dan diameter luarnya 2 m. Tentukan rasio resistansi R <sub>A</sub> |R <sub>B</sub> (Keduanya berbahan sama, Panjangnya sama)</p> ', NULL, 'D', 5, '2.5'),
(137, 1, 6, 0, 0, 'Paket 1 no 22', '<p>Suatu resistor akan mengkonsumsi daya sebesar 0,5 W, apabila resistor ini dihubungkan dengan sumber tegangan 3 V. Jika kita ganti sumber tegangannya, resistor yang sama ini diberi tegangan 1 V, berapakah daya yang dipakai resistor</p> ', NULL, 'D', 5, '2.5'),
(138, 1, 6, 0, 0, 'Paket 1 no 30', '<p>Suatu gas mengalami proses dimana tekanan (p) berubah terhadap volum (V). D (Sulit) Besarnya usaha yang dilakukan oleh gas selama proses berlangsung adalah....:</p> ', NULL, 'D', 5, '2.5'),
(139, 1, 6, 0, 0, 'Paket 1 no 31', '<p>Gas ideal pada suhu 293 K, pada tekanan 1 atm (76 cm Hg) terukur memiliki volume 12 liter. Jika suhunya ditingkatnya menjadi 373 K, dan tekanan ditingkatkan menjadi 215 cm Hg, maka volume total menjadi ....:</p> ', NULL, 'B', 5, '2.5'),
(140, 1, 6, 0, 0, 'Paket 1 no 32', '<p>Kawat lurus sangat panjang yang dialiri arus listrik menghasilkan kuat medan magnet sebesar 2&times;10 <sup>-5</sup> T pada titik yang jaraknya 2 cm dari kawat. Berapakah besarnya arus listrik yang mengalir di kawat ini ?</p> ', NULL, 'C', 5, '2.5'),
(141, 1, 6, 0, 0, 'Paket 1 no 34', '<p>Satu ektron (besar muatan q = &ndash;1.6 ́ 10 <sup>&ndash;19</sup> C) bergerak pada bidang xy yang dipengaruhi medan magnet 0.8 T (arah medan magnet ke sumbu x positif), jika kecepatan v <sub>x</sub> = 5 ́ 10 <sup>5</sup> m/s dan v <sub>y </sub>= 3 ́ 10 <sup>5</sup> m/s. Tentukan besarnya gaya magnetik yang bekerja pada elektron.</p> ', NULL, 'B', 5, '2.5'),
(142, 1, 6, 0, 0, 'Paket 1 no 36', '<p>Seseorang mendengar bunyi sirine berfrekuensi 700 Hz dipancarkan oleh C sebuah ambulance yang sedang bergerak mendekatinya. Setelah ambulance Mudah lewat dan bergerak menjauhinya, nada sirine terdengar olehnya berfrekuensi 620 Hz. Jika laju gelombang bunyi di udara adalah 330 m/s, maka laju ambulance tersebut adalah...</p> ', NULL, 'C', 5, '2.5'),
(143, 1, 6, 0, 0, 'Paket 1 no 37', '<p>Berapa kelajuan yang harus dimiliki benda agar besarnya energi kinetik benda ini bernilai 25% kali energi diamnya (m <sub>0</sub> c <sup>2</sup> ). Dalam hal ini c adalah laju cahaya dalam ruang vakum.</p> ', NULL, 'C', 5, '2.5'),
(144, 1, 6, 0, 0, 'Paket 1 no 38', '<p>Pada keadaan diam, Meson memerlukan waktu 2 &mu; s untuk meluruh dan berubah menjadi partikel lain setelah terbentuknya. Jika Meson bergerak di dalam lab, dengan laju 0.99c, berapa lama usia Meson sebelum berubah menjadi partikel lain menurut kerangka acuan Lab.</p> ', NULL, 'C', 5, '2.5'),
(145, 1, 6, 0, 0, 'Paket 1 no 39', '<p>Jika frekuensi cahaya A adalah dua kali dari frekuensi cahaya B. Tentukan rasio energi foton E <sub>A</sub> /E <sub>B</sub></p> ', NULL, 'D', 5, '2.5'),
(146, 1, 6, 0, 0, 'Paket 1 no 40', '<p>Jika besarnya energi cahaya A dua kali besarnya energi cahaya B. tentukan rasio momentum foton p <sub>A</sub> /p <sub>B</sub></p> ', NULL, 'D', 5, '2.5'),
(147, 1, 6, 3, 7, 'Paket 1 no 7', 'SOAL-24062020113638-BfFTd.png', '<p>Empat vektor (<u>A</u> , <u>B</u> , <u>C</u> , <u>D</u> ) yang besarnya (panjangnya) sama dan satu sama lain terpisah dengan besarnya sudut pemisah 45&deg;, lihat gambar. Manakah persamaan vektor yang benar di bawah ini.</p>', 'B', 5, '2.5'),
(148, 1, 6, 2, 4, 'Paket 1 no 8', 'SOAL-24062020113803-sC6mF.png', '<p>Manakah dari 5 gambar (A, B, C, D, E) di bawah ini, yang memberikan informasi gerak objek dengan laju konstan (x posisi, dan t waktu).</p>', 'B', 5, '2.5'),
(149, 1, 6, 2, 4, 'Paket 1 no 9', 'SOAL-24062020113931-bDdPM.png', '<p>Grafik kecepatan di bawah ini menyatakan gerak benda pada lintasan lurus. Hitunglah seberapa jauh jarak yang telah ditempuh pada selang waktu antara<em> t </em>= 2 sekon dan <em>t </em>= 5 sekon?</p>', 'D', 5, '2.5'),
(150, 1, 6, 2, 4, 'Paket 1 no 10', 'SOAL-24062020114052-5RoHw.png', '<p>Pesawat tempur terbang di ketinggian 0.50 km dan sedang bergerak dengan laju 150 km/jam. Pada jarak (d) berapakah pesawat mulai menembakan bom (abaikan gesekan udara) agar bom mengenai target di X. (percepatan gravitasi g = 10 m/s<sup> 2</sup> .)</p>', 'C', 5, '2.5'),
(151, 1, 6, 2, 4, 'Paket 1 no 11', 'SOAL-24062020114141-zAoV4.png', '<p>Dua benda berada pada posisi diam, terhubung seperti pada gambar (asumsi tali tidak elastis, dan katrol tidak berputar), gaya berat (W) kedua benda adalah sama. Tentukan gaya gesek pada benda (balok) yang berada di atas bidang miring.</p>', 'B', 5, '2.5'),
(152, 1, 6, 2, 4, 'Paket 1 no 14', 'SOAL-24062020114359-IamIl.png', '<p>Bandul sederhana terbuat dari bola bermassa 2.0 kg terikat pada tali tipis (dianggap massa tali dapat diabaikan dibandingkan massa bola). Bola disimpangkan dan menempati posisi X, yang berada 1,85 m diatas titik Y(titik terendah pendulum), tentukan besarnya kecepatan di Y. A) 0.90 m/s</p>', 'D', 5, '2.5'),
(153, 1, 6, 2, 4, 'Paket 1 no 15', 'SOAL-24062020114457-7kwLt.png', '<p>Pegas yang ideal (elastis) digunakan untuk menggantung benda. Ketika gaya berat benda 100 N, skala pada penggaris menunjukan angka &quot;40&quot;, namun jika menggunakan benda lainnya yang gaya beratnya 200 N menunjukan skala &quot;60&quot;. Jika kita gantungkan benda yang tidak diketahui gaya beratnya, lalu pada skala menunjukan angka &quot;30&quot;. Berapakah besarnya gaya berat benda ini.</p>', 'E', 5, '2.5'),
(154, 1, 6, 3, 7, 'Paket 1 no 16', 'SOAL-24062020114546-SqgI8.png', '<p>Suatu balok yang mula-mula diam di titik P, lalu setelah dibiarkan terlepas maka meluncur dan bergerak ke titik Q. Asumsikan sepanjang lintasan tidak ada gesekan. Tentukan besarnya kecepatan balok di titik Q.</p>', 'D', 5, '2.5'),
(155, 1, 6, 2, 4, 'Paket 1 no 17', 'SOAL-24062020114710-aqNTx.png', '<p>Bola menumbuk lantai dan terpantul. Sebelum dan sesudah tumbukan tidak terjadi perubahan besarnya laju pada bola. Tentukan besarnya perubahan momentum yang dimiliki bola pada arah x dan arah y</p>', 'C', 5, '2.5'),
(156, 1, 6, 2, 4, 'Paket 1 no 18', 'SOAL-24062020114803-f5gVl.png', '<p>Dua gerobak A dan B, dipasang pegas seperti pada gambar, keduanya bertumbukan, ketika gerobak A bergerak mendekati gerobak B yang awalnya diam. Massa gerobak A 2 kg, dan B bermassa 3 kg. Pada peristiwa ini, ketika kita mengamati kedua benda tersebut saat jarak antara keduanya mencapai nilai minimum (jarak terdekat, kedua pegas sangat tertekan sehingga gerobak A dan B saling menempel), maka dapat disimpulkan keadaan sebagai berikut:</p>', 'E', 5, '2.5'),
(157, 1, 6, 2, 4, 'Paket 1 no 19', 'SOAL-24062020114856-LPbdj.png', '<p>Tiga bola (ball) identik terikat pada tongkat yang sama melalui tali yang tipis dimana massa tali dapat diabaikan dibandingkan massa bola tersebut. Panjang tali berbeda untuk masing-masing bola. Jika ketiga bola diputar, urutkan besarnya momen inersia (diurut dari yang terkecil ke</p>', 'A', 5, '2.5'),
(158, 1, 6, 2, 4, 'Paket 1 no 20', 'SOAL-24062020115026-P1PUI.png', '<p>Balok bermassa 16 kg diikat dengan tali yang dililitkan pada katrol. Diameter katrol adalah 0.40 m, katrol dapat berputar bebas ketika balok bergerak turun. Momen inersia katrol 0.50 kg &times; m<sup> 2 </sup>. Tentukan percepatan balok, ketika dilepaskan dari keadaan diamnya.</p>', 'B', 5, '2.5'),
(159, 1, 6, 2, 4, 'Paket 1 no 23', 'SOAL-24062020115148-Vgr0T.png', '<p>Pada rangkaian listrik arus searah ini digunakan tiga resistor yang besarnya resistansi R <sub>1</sub> &gt; R <sub>2</sub> &gt; R <sub>3 </sub>. Urutkan besarnya arus yang mengalir yang melalui masing- masing resistor (urutkan dari yang terkecil ke yang terbesar).</p>', 'E', 5, '2.5'),
(160, 1, 6, 2, 4, 'Paket 1 no 24', 'SOAL-24062020120745-GM8GQ.png', '<p>Berapa besar arus listrik yang mengalir pada resistor 5.0-W</p>', 'C', 5, '2.5'),
(161, 1, 6, 2, 4, 'Paket 1 no 25', 'SOAL-24062020120835-COfVY.png', '<p>Bejana dengan bentuk bervariasi seperti pada gambar, diisi air dengan ketingian yang sama. Urutkan dari yang terkecil ke yang terbesar, besarnya tekanan yang diberikan air ke dasar bejana.</p>', 'E', 5, '2.5'),
(162, 1, 6, 2, 4, 'Paket 1 no 26', 'SOAL-24062020120923-F7MYn.png', '<p>Diketahui densitas air (<em>water</em>) 1,0 g/cm 3 , tentukan densitas minyak (<em>oil</em>)pada pada sisi tabung sebelah kiri</p>', 'B', 5, '2.5'),
(163, 1, 6, 2, 4, 'Paket 1 no 27', 'SOAL-24062020121458-Jr5qb.png', '<p>Pada gambar menjelaskan pipa dengan luas penampang yang sama, dialiri air yang mengalir dengan arah aliran seperti ditunjukan oleh arah panah, dan tiap pipa diberikan besarnya debit air (dalam cm<sup>3</sup> /s). Tentukan arah dan besarnya debit di pipa A</p>', 'E', 5, '2.5'),
(164, 1, 6, 2, 4, 'Paket 1 no 28', 'SOAL-24062020121832-OEzJs.png', '<p>Sebuah bejana besar yang terbuka bagian atasnya berisi fluida yang terdiri dari air dan minyak dimana tebal lapisan air h A = 1,2 m (rapat massa air 1 g/cm 3 ) dan tebal lapisan minyak h M = 1 m (rapat massa minyak 0,8 g/cm<sup>3</sup> ) seperti ditunjukkan pada gambar di bawah. Pada bagian alas bejana, dibuat lubang sangat kecil sehingga air keluar dari lubang tersebut. Berapa laju 4 aliran air yang keluar dari lubang tersebut? (g = 10 m|s<sup>2</sup> , H = 2 m)</p>', 'E', 5, '2.5'),
(165, 1, 6, 2, 4, 'Paket 1 no 29', 'SOAL-24062020121936-SEe6t.png', '<p>Dua tali A dan B memiliki panjang dan rapat massa yang sama, tetapi tegangan kedua tali berbeda. Tegangan tali A 4 kali lebih besar daripada tegangan tali B. Jika pada masing-masing tali tali tersebut terjadi gelombang berdiri seperti tampak pada gambar, maka perbandingan frekuensi gelombang pada tali A terhadap tali B adalah .....</p>', 'A', 5, '2.5'),
(166, 1, 6, 2, 4, 'Paket 1 no 33', 'SOAL-24062020122022-ydHhd.png', '<p>Tiga buah rangkaian pada gambar di bawah ini dialiri arus bolak-balik (AC). Lampu pada rangkaian mana yang menyala paling terang jika frekuensi yang digunakan adalah frekuensi resonansinya ?</p>', 'C', 5, '2.5'),
(167, 1, 6, 2, 4, 'Paket 1 no 35', 'SOAL-24062020122122-41nmN.png', '<p>Empat gambar di bawah ini, adalah susunan lokasi muatan listrik yang tersebar merata, yang jaraknya ke titik pusat adalah sama. Beberapa pernyataan terkait arah atau besarnya medan listrik di titik pusat koordinat adalah (sumbu vertikal y, sumbu horizontal x)</p>', 'C', 5, '2.5'),
(168, 1, 4, 0, 0, 'Paket 1 no 1', 'Setiap makhluk hidup memiliki kesamaan ciri antara mereka yang membedakan mereka dari makhluk non biologis. Berikut ini adalah ciri-ciri dari makhluk hidup kecuali.…', NULL, 'A', 5, '2.5'),
(169, 1, 4, 0, 0, 'Paket 1 no 2', 'Metabolisme ...…', NULL, 'A', 5, '2.5'),
(170, 1, 4, 0, 0, 'Paket 1 no 3', 'Struktur yang digunakan oleh beberapa organisme untuk bergerak adalah', NULL, 'E', 5, '2.5'),
(171, 1, 4, 0, 0, 'Paket 1 no 4', 'Satu amuba berubah menjadi 2 amuba, ini merupakan contoh dari', NULL, 'C', 5, '2.5'),
(172, 1, 4, 0, 0, 'Paket 1 no 5', 'Peningkatan ukuran atau jumlah sel merupakan proses', NULL, 'B', 5, '2.5'),
(173, 1, 4, 0, 0, 'Paket 1 no 6', 'DNA...?', NULL, 'A', 5, '2.5'),
(174, 1, 4, 0, 0, 'Paket 1 no 7', 'Pasangan manakah yang tidak sesuai?', NULL, 'C', 5, '2.5'),
(175, 1, 4, 0, 0, 'Paket 1 no 8', '<p>Fase pembelahan meiosis mempunyai ciri sebagai berikut:<br /> - Kromosom bergerak pada bidang ekuator<br /> - Setiap benang gelondong mengikat satu kromosom dan bertumpu pada sentromernya<br /> Fase pembelahan yang paling tepat berdasarkan ciri-ciri tersebut adalah .....</p> ', NULL, 'C', 5, '2.5'),
(176, 1, 4, 0, 0, 'Paket 1 no 9', 'Kehidupan memiliki hirarki (tingkatan) berdasarkan tingkat kerumitan dari interaksi antar komponen. Berikut urutan hirarki sistem kehidupan yang paling tepat adalah (dari sederhana hingga paling kompleks.', NULL, 'D', 5, '2.5'),
(177, 1, 4, 0, 0, 'Paket 1 no 10', 'Seluruh makhluk hidup yang ditemukan di suatu lahan pertanian adalah...', NULL, 'B', 5, '2.5'),
(178, 1, 4, 0, 0, 'Paket 1 no 11', 'Kondisi lingkungan yang sehat merupakan hal yang penting dalam bagi kesehatan manusia. Bentuk pencemaran yang paling umum ditemukan di pemukiman manusia di kota besar adalah pencemaran udara. Beberapa penelitian di bawah ini dapat digunakan sebagai bentuk pendekatan ilmiah untuk menguji tingkat pencemaran udara di kota, kecuali', NULL, 'D', 5, '2.5'),
(179, 1, 4, 0, 0, 'Paket 1 no 12', 'Pada pembagian makhluk hidup kita mengenal istilah sel prokariot dan eukariot. Terdapat perbedaan pada organel-organel yang menyusun kedua sel ini. Manakah di antara organel- organel di bawah ini yang hanya ditemukan pada sel-sel eukariot?', NULL, 'B', 5, '2.5'),
(180, 1, 4, 0, 0, 'Paket 1 no 13', 'Sel pada pankreas akan menggabungkan asam amino yang diberi penanda radioaktif ke dalam rantai protein yang sedang dibentuk (sintesis). Penandaan terhadap protein yang baru disinteis ini memungkinkan para peneliti untuk menelusuri lokasi protein ini di dalam sel. Pada kasus ini, kita menelusuri enzim yang disekresikan oleh sel pankreas. Manakah jalur pergerakan protein tersebut didalam sel yang paling tepat?', NULL, 'B', 5, '2.5'),
(181, 1, 4, 0, 0, 'Paket 1 no 14', 'Salah satu proses penting dalam kehidupan di muka bumi adalah proses metabolisme, yang mengurasikan 1 mol glukosa menjadi ATP yang merupakan “mata uang energi” bagi sel. Secara garis besar terdapat dua jenis model metabolisme yaitu respirasi selular dan fermentasi. Bila sel yang melakukan metabolisme adalah sel bakteri golongan laktat homofermentatif, berapakah nilai ATP yang dihasilkan dari proses penguraian 1 mol glukosa?', NULL, 'B', 5, '2.5'),
(182, 1, 4, 0, 0, 'Paket 1 no 15', 'ATP merupakan energi yang digunakan pada proses metabolisme di makhluk hidup. ATP juga digunakan pada berbagai proses di makhluk hidup seperti disebutkan di bawah ini, kecuali.…', NULL, 'D', 5, '2.5'),
(183, 1, 4, 0, 0, 'Paket 1 no 16', 'Proses pergerakan air dan mineral pada akar melewati suatu jalur tertentu, yaitu...', NULL, 'C', 5, '2.5'),
(184, 1, 4, 0, 0, 'Paket 1 no 18', 'Biji tanaman pada umumnya mengalami proses dormansi dimana mereka menunggu waktu yang tepat untuk tumbuh. Hormon yang mengatur hal ini adalah…', NULL, 'B', 5, '2.5'),
(185, 1, 4, 0, 0, 'Paket 1 no 19', '<p>Sekelompok tim olimpiade sains sedang melakukan suatu eksperimen berbasis respirasi seluler untuk menguji hipotesis berikut: &rdquo; Jika ragi menggunakan glukosa sebagai sumber energi, maka semakin banyak glukosa yang ditambahkan ke dalam medium, semakin banyak populasi yang akan tumbuh&rdquo; Untuk menguji hipotesis tersebut, tim mengisi empat buah tabung dengan 5 ml medium pertumbuhan minimum dan menambahkan 0 ml glukosa pada tabung pertama, 5 ml pada tabung ke-2, 10 ml pada tabung ke-3, dan 20 ml pada tabung ke-4. Setelah satu hari, ia memperoleh data sebagai berikut:</p>\r\n\r\n<table align=\"center\" border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><strong>Tabung 1</strong></td>\r\n			<td style=\"text-align:center\"><strong>Tabung 2</strong></td>\r\n			<td style=\"text-align:center\"><strong>Tabung 3</strong></td>\r\n			<td style=\"text-align:center\"><strong>Tabung 4</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">20 ragi/mm<sup>3</sup></td>\r\n			<td style=\"text-align:center\">200 ragi/mm<sup>3</sup></td>\r\n			<td style=\"text-align:center\">60 ragi/mm<sup>3</sup></td>\r\n			<td style=\"text-align:center\">0 ragi/mm<sup>3</sup></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">pH = 7,0</td>\r\n			<td style=\"text-align:center\">pH = 6,5</td>\r\n			<td style=\"text-align:center\">pH = 6,8</td>\r\n			<td style=\"text-align:center\">pH = 7,2</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><br />\r\nData di atas menunjukan bahwa .....</p>\r\n', NULL, 'B', 5, '2.5'),
(186, 1, 4, 0, 0, 'Paket 1 no 23', 'Seorang siswa SMA mengamati awetan dari sel stomata tanaman C3 yang dihasilkan oleh mahasiswa biologi dari tanaman yang dipelihara di laboratorium. Siswa tersebut mendapatkan bahwa sel-sel stomata dari daun tersebut terbuka. Berdasarkan informasi ini maka dapat disimpulkan bahwa.…', NULL, 'E', 5, '2.5'),
(187, 1, 4, 0, 0, 'Paket 1 no 24', 'Tumbuhan C3 umumnya ditemukan pada kondisi lingkungan yang sejuk dan lembab, dibandingkan dengan tumbuhan C4. Tumbuhan C4 tumbuh lebih baik pada kondisi lingkungan yang kering dan panas, karena..…', NULL, 'A', 5, '2.5'),
(188, 1, 4, 0, 0, 'Paket 1 no 25', 'Andi melakukan percobaan menanam tumbuhan bersifat mesofit pada tanah dengan konsentrasi garam tinggi. Keesokan harinya dia mendapatkan bahwa tanaman yang dia pelihara layu. Hal yang dapat dilakukan untuk mengatasi kondisi layu pada tanaman adalah', NULL, 'B', 5, '2.5'),
