(194, 1, 4, 0, 0, 'Paket 1 no 33', '<p>Pada suatu toples terdapat biji hasil persilangan. Setelah biji tersebut di tanam sampai berbuah untuk pertama kalinya diperoleh data sebagai berikut :</p>  <p>31 hijau<br /> 10 kuning<br /> 39 tak berwarna<br /> Dari data di atas pilihlah pasangan genotip berikut yang merupakan induk dari tanaman-tanaman tersebut...</p> ', NULL, 'D', 5, '2.5'),
