(198, 1, 4, 2, 4, 'Paket 1 no 17', 'SOAL-25062020121924-jE8nE.png', '<p>Grafik di atas menunjukkan laju proses fotosintesis dari 4 tanaman dasar perairan yang dikoleksi dari 4 daerah dengan kedalaman berbeda.</p>\r\n\r\n<p>Berdasarkan informasi di atas, maka tanaman yang berasal dari daerah terdalam adalah....</p>', 'D', 5, '2.5'),
(199, 1, 4, 2, 4, 'Paket 1 no 20', 'SOAL-25062020122047-Uj4G0.png', '<p>Perhatikanlah diagram di atas ini yang menunjukkan suatu percobaan dimana terdapat dua larutan yang dipisahkan oleh suatu membran!</p>\r\n\r\n<p>Berdasarkan gambar di atas, setelah 5 menit dibiarkan tanpa pengadukan maupun penambahan suhu, maka hal yang akan terjadi adalah (bila diasumsikan kecepatan perpindahan gula dalam cairan adalah 1/20 bagian dari volume per menit) :</p>', 'C', 5, '2.5'),
(200, 1, 4, 2, 4, 'Paket 1 no 21', 'SOAL-25062020122637-NzGwl.png', '<p>Gambar di atas ini merupakan struktur kimia dari molekul DNA</p>\r\n\r\n<p>Struktur ini dapat dirusak dengan menggunakan panas dan menjadi salah satu metoda standar pada bidang biologi molekular. Terdapat 4 urutan DNA dari 4 makhluk hidup dengan proporsi jumlah A dan C sebagai berikut</p>\r\n\r\n<table align=\"center\" border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Spesies</strong></td>\r\n			<td><strong>Proporsi A (&amp; dari total )</strong></td>\r\n			<td><strong>Proporsi C (% dari total)</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">A</td>\r\n			<td style=\"text-align:center\">20</td>\r\n			<td style=\"text-align:center\">10</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">B</td>\r\n			<td style=\"text-align:center\">30</td>\r\n			<td style=\"text-align:center\">30</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">C</td>\r\n			<td style=\"text-align:center\">15</td>\r\n			<td style=\"text-align:center\">20</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">D</td>\r\n			<td style=\"text-align:center\">40</td>\r\n			<td style=\"text-align:center\">15</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Berdasarkan informasi di atas dan dengan mempertimbangkan sifat dari struktur kimia dari DNA maka urutan dari spesies yang memiliki daya tahan tinggi dengan suhu tinggi ke spesies paling rentan terhadap suhu tinggi adalah ....</p>', 'B', 5, '2.5'),
(201, 1, 4, 2, 4, 'Paket 1 no 22', 'SOAL-25062020122745-xF0a7.png', '<p>Suatu percobaan dilakukan untuk mengamati proses fotosintesis pada tumbuhan air. Percobaan tersebut menghasilkan grafik seperti di bawah ini.</p>\r\n\r\n<p>Berdasarkan grafik di atas, maka dapat ditarik kesimpulan bahwa....</p>', 'D', 5, '2.5'),
(202, 1, 4, 2, 4, 'Paket 1 no 26', 'SOAL-25062020122932-UR047.png', '<p>Gambar di atas ini menunjukkan proses pengangkutan gula, hasil fotosintesis, di dalam tubuh tumbuhan.</p>\r\n\r\n<p>Struktur yang sesuai berdasarkan gambar adalah....</p>', 'C', 5, '2.5'),
(203, 1, 4, 2, 4, 'Paket 1 no 30', 'SOAL-25062020123324-hmRxw.png', '<p>Gambar di atas menunjukkan pola dari keberadaan antibodi sebagai respon dari sistem imun tubuh. Berdasarkan grafik di atas, maka respon sistem imun tubuh pada hari ke-5 kemungkinan besar disebabkan oleh kerja dari....</p>', 'C', 5, '2.5'),
