(205, 1, 4, 2, 4, 'Paket 1 no 38', 'SOAL-25062020123541-abs3p.png', '<p>Apabila 10% energi yang tersedia pada setiap tingkatan trofik diubah menjadi biomassa baru pada tingkatan trofik diatasnya. Berapa jumlah energi yang didapatkan oleh tingkatan trofik D apabila produsen memiliki energi 10.000 J ?</p>', 'C', 5, '2.5'),
(206, 1, 4, 2, 4, 'Paket 1 no 37', 'SOAL-25062020124111-MO5ML.png', '<p>Sekelompok siswa SMA mendapatkan tugas untuk mengamati populasi dari pohon pada kebun biologi di dekat sekolah mereka. Dengan bantuan foto udara mereka mendapatkan gambaran populasi pohon sebagai berikut.</p>\r\n\r\n<p>Di dalam suatu plot pengamatan seluas 100 m 2 diketahui terdapat pohon A (Lingkaran), pohon B(Segitiga terbalik), dan pohon C (segi lima terbalik ). Berapakah kerapatan (density) individu A?.....</p>', 'C', 5, '2.5'),
(207, 1, 4, 2, 4, 'paket 1 no 34', 'SOAL-25062020152441-kT5dt.png', '<p>Berdasarkan silsilah di atas dapat disimpulkan bahwa cara pewarisan alel penyebab penyakit tersebut adalah...</p>', 'D', 5, '2.5'),
