(298, 1, 10, 0, 0, 'Paket 1 no 1', 'Rumah Budi terletak di Banda Aceh dan rumah Dani terletak di Medan. Jarak absolut antara rumah Budi dan Dani adalah 600 km yang dapat ditempuh dengan mobil selama 12 jam dan 1 jam jika ditempuh dengan pesawat. Konsep geografi yang berkaitan dengan ilustrasi tersebut adalah…', NULL, 'D', 5, '2'),
(299, 1, 10, 0, 0, 'Paket 1 no 2', 'Indonesia memiliki tiga corak fauna, yaitu oriental, australis, dan peralihan yang tersebar di Indonesia bagian barat, timur, dan tengah. Kondisi ini disebabkan oleh faktor geologis Indonesia yang terdiri dari tiga lempeng. Prinsip geografi yang dapat digunakan untuk menjelaskan fenomena tersebut adalah…', NULL, 'D', 5, '2'),
(300, 1, 10, 0, 0, 'Paket 1 no 3', 'Fenomena El Nino mengakibatkan musim kemarau di Indonesia dan musim hujan di pantai barat Amerika Selatan. Pendekatan geografi yang paling tepat untuk mengkaji fenomena El Nino adalah…', NULL, 'A', 5, '2'),
(301, 1, 10, 0, 0, 'Paket 1 no 4', '<p>Perhatikan contoh fenomena berikut ini:<br /> (1) Evakuasi penduduk karena bencana alam<br /> (2) Letusan gunung api dan tsunami<br /> (3) Kerja sama bilateral dalam eksplorasi bahan tambang<br /> (4) Pola pemukiman memusat di dataran rendah<br /> (5) Bencana banjir di kawasan pemukiman<br /> (6) Pasang air laut yang menyebabkan banjir rob<br /> Aspek sosial dalam kajian geografi ditunjukkan oleh angka...</p>', NULL, 'B', 5, '2'),
(302, 1, 10, 0, 0, 'Paket 1 no 5', '<p>Pernyataan:<br /> (1) Pergantian musim di kedua belahan Bumi<br /> (2) Indonesia dibagi menjadi tiga zona waktu<br /> (3) Perbedaan jumlah hari di tahun kabisat<br /> (4) Adanya coriolis effect<br /> (5) Pergantian siang dan malam<br /> Fenomena yang terjadi akibat rotasi Bumi terdapat pada angka...</p> ', NULL, 'C', 5, '2'),
