(308, 1, 10, 0, 0, 'Paket 1 no 16', '<p>Pernyataan:<br /> (1) Terletak di wilayah iklim subtropis<br /> (2) Memiliki musim dingin yang panjang<br /> (3) Memiliki pohon berdaun jarum<br /> Bioma yang sesuai dengan ciri-ciri tersebut adalah...</p> ', NULL, 'A', 5, '2'),
(309, 1, 10, 0, 0, 'Paket 1 no 17', '<p>Ciri-ciri iklim wilayah:<br /> (1) Amplitudo suhu harian tinggi<br /> (2) Curah hujan kurang dari 250 mm/tahun<br /> (3) Kelembaban udara sangat rendah<br /> (4) Vegetasi rumput sangat luas<br /> Aktivitas ekonomi yang cocok dilakukan di wilayah tersebut adalah...</p> ', NULL, 'A', 5, '2'),
(310, 1, 10, 0, 0, 'Paket 1 no 20', '<p>Perhatikan karakteristik laut berikut ini!<br /> (1) Kedalaman kurang dari 200 meter<br /> (2) Cahaya matahari dapat menembus dasar laut<br /> (3) Merupakan tempat pemusatan ikan<br /> Pemanfaatan laut yang sesuai dengan karakteristik tersebut adalah...</p> ', NULL, 'C', 5, '2'),
(311, 1, 10, 0, 0, 'Paket 1 no 21', 'Indonesia memiliki intensitas curah hujan yang semakin rendah dari barat ke timur. Kondisi ini berdampak pada persebaran jenis hutan di Indonesia. Persebaran jenis hutan di Indonesia dari timur ke barat yaitu…', NULL, 'B', 5, '2'),
(312, 1, 10, 0, 0, 'Paket 1 no 24', 'Contoh barang galian tambang industri (golongan C) adalah…', NULL, 'B', 5, '2'),
(313, 1, 10, 0, 0, 'Paket 1 no 26', 'Bahan tambang yang digunakan untuk pelapis peralatan masak agar tidak cepat berkarat adalah…', NULL, 'C', 5, '2'),
(314, 1, 10, 0, 0, 'Paket 1 no 27', 'Salah satu permasalahan kependudukan di Indonesia adalah tingginya infant mortality rate. Usaha yang dapat dilakukan untuk mengatasi hal tersebut adalah…', NULL, 'A', 5, '2'),
(315, 1, 10, 0, 0, 'Paket 1 no 29', '<p>Pernyataan:<br /> (1) Perpindahan dari desa ke kota<br /> (2) Durasi perpindahan selama satu hari<br /> (3) Dilakukan secara rutin setiap hari<br /> Perpindahan yang dimaksud oleh pernyataan tersebut adalah...</p> ', NULL, 'C', 5, '2'),
(316, 1, 10, 0, 0, 'Paket 1 no 30', 'Pembangunan kawasan industri di area pertanian berdampak pada tingkat pencemaran yang tinggi terhadap tanah dan udara. Tindakan yang mendukung prinsip pembangunan berkelanjutan terkait dengan hal tersebut adalah…', NULL, 'A', 5, '2'),
(317, 1, 10, 0, 0, 'Paket 1 no 31', 'Pembangunan Pembangkit Listrik Tenaga Uap (PLTU) memiliki dampak besar terhadap kerusakan lingkungan, karena…', NULL, 'A', 5, '2'),
(318, 1, 10, 0, 0, 'Paket 1 no 32', 'Pembangunan hotel dan resort di lereng pegunungan dapat meningkatkan potensi erosi dan longsor. Oleh karena itu, pembangunan hotel dan resort tersebut perlu dilakukan berdasarkan prinsip pembangunan berkelanjutan, yaitu…', NULL, 'B', 5, '2'),
(319, 1, 10, 0, 0, 'Paket 1 no 33', '<p>Suatu objek pada citra memiliki ciri-ciri sebagai berikut:<br /> (1) Bentuk berupa petak-petak<br /> (2) Terdapat di dataran rendah<br /> (3) Tekstur halus<br /> (4) Terdapat saluran irigasi<br /> Objek yang dimaksud adalah...</p> ', NULL, 'A', 5, '2'),
(320, 1, 10, 0, 0, 'Paket 1 no 34', 'Manfaat penginderaan jauh di bidang meteorologi dan klimatologi adalah, kecuali…', NULL, 'C', 5, '2'),
(321, 1, 10, 0, 0, 'Paket 1 no 36', '<p>Jenis-jenis peta:<br /> (1) Peta Curah Hujan<br /> (2) Peta Topografi<br /> (3) Peta Jenis Tanah<br /> Hasil overlay dari ketiga peta tersebut akan menghasilkan...</p> ', NULL, 'D', 5, '2'),
(322, 1, 10, 0, 0, 'Paket 1 no 38', 'Seorang petugas BNPB bermaksud membuat peta jalur evakuasi bencana letusan gunungapi. Maka jenis peta yang diperlukan untuk diolah adalah…', NULL, 'B', 5, '2'),
(323, 1, 10, 0, 0, 'Paket 1 no 39', '<p>Data Sistem Informasi Geografis:<br /> (1) Daftar nama kabupaten<br /> (2) Jumlah penduduk<br /> (3) Lokasi sekolah<br /> (4) Lokasi pasar<br /> (5) Lokasi kecamatan<br /> (6) Nama sungai<br /> Jenis data atribut ditunjukkan oleh angka...</p>', NULL, 'B', 5, '2'),
(324, 1, 10, 0, 0, 'Paket 1 no 40', 'Selain memiliki banyak keunggulan, Sistem Informasi Geografis pun memiliki beberapa kelemahan. Salah satu kelemahan dari penggunaan Sistem Informasi Geografi adalah…', NULL, 'A', 5, '2'),
(325, 1, 10, 0, 0, 'Paket 1 no 41', 'Salah satu manfaat dari penggunaan Sistem Informasi Geografis dalam bidang tata ruang kota adalah…', NULL, 'B', 5, '2'),
(326, 1, 10, 0, 0, 'Paket 1 no 42', '<p>Karakteristik permukiman di suatu desa:<br /> (1) Ketersediaan air tanah sedikit<br /> (2) Kesuburan tanah tidak merata<br /> (3) Terletak di daerah kapur<br /> Berdasarkan karakteristik tersebut, pola permukiman yang dimaksud adalah...</p> ', NULL, 'E', 5, '2'),
(327, 1, 10, 0, 0, 'Paket 1 no 43', '<p>Ciri-ciri masyarakat desa:<br /> (1) Aktivitas ekonomi sangat bergantung pada alam<br /> (2) Penduduk desa sudah berinteraksi dengan penduduk kota<br /> (3) Hubungan kekerabatan antar penduduk sangat erat<br /> (4) Aktivitas ekonomi mulai beralih ke sektor jasa<br /> (5) Tingkat pendidikan masyarakat masih rendah<br /> Ciri-ciri desa swakarya ditunjukkan oleh nomor...</p>', NULL, 'B', 5, '2'),
(328, 1, 10, 0, 0, 'Paket 1 no 45', 'Berikut ini contoh dari faktor spatial transfer ability dalam interaksi wilayah desa dan kota adalah…', NULL, 'A', 5, '2'),
(329, 1, 10, 0, 0, 'Paket 1 no 46', 'Kota G berjarak 42 km dari Kota H. Kota G memiliki penduduk sebanyak 28.000 jiwa sedangkan Kota H memiliki 112.000 jiwa. Maka titik henti antara kedua kota tersebut adalah…', NULL, 'B', 5, '2'),
(330, 1, 10, 0, 0, 'Paket 1 no 47', 'Usaha yang dapat dilakukan untuk mengatasi penetrasi pola hidup konsumtif penduduk kota ke penduduk desa adalah…', NULL, 'B', 5, '2'),
(331, 1, 10, 0, 0, 'Paket 1 no 48', 'Sebuah pusat pertumbuhan memiliki tingkat perkembangan wilayah yang sangat pesat sehingga mampu mendorong wilayah di sekitarnya untuk berkembang lebih cepat. Salah satu faktor yang mendorong suatu wilayah menjadi pusat pertumbuhan adalah…', NULL, 'C', 5, '2'),
(332, 1, 10, 0, 0, 'Paket 1 no 49', '<p>Ciri-ciri suatu negara:<br /> (1) tingkat pengangguran rendah<br /> (2) angka harapan hidup tinggi<br /> (3) angka kelahiran rendah<br /> (4) infrastruktur masih terbatas<br /> (5) pendapatan perkapita rendah<br /> Ciri-ciri developed country ditunjukkan oleh nomor...</p>', NULL, 'A', 5, '2'),
(333, 1, 10, 2, 4, 'Paket 1 no 6', 'SOAL-08072020215201-WapPy.png', '<p>Perhatikan gambar di atas ini!</p>\r\n\r\n<p>Dampak yang <strong>tidak</strong> ditimbulkan oleh peristiwa pada gambar di samping adalah...</p>', 'E', 5, '2'),
(334, 1, 10, 2, 4, 'Paket 1 no 7', 'SOAL-08072020215317-FGy9F.png', '<p>Perhatikan diagram siklus geologi di atas ini!</p>\r\n\r\n<p>Batuan yang terbentuk akibat proses pengendapan dan suhu serta tekanan yang\r\ntinggi ditunjukkan oleh huruf...</p>', 'C', 5, '2'),
(335, 1, 10, 2, 4, 'Paket 1 no 8', 'SOAL-08072020215357-nBHjO.png', '<p>Bentukan pantai fyord seperti pada gambar disebabkan oleh tenaga...</p>', 'C', 5, '2'),
(336, 1, 10, 2, 4, 'Paket 1 no 13', 'SOAL-08072020215445-voP32.png', '<p>Lapisan atmosfer beserta fungsinya yang tepat adalah...</p>', 'D', 5, '2'),
(337, 1, 10, 2, 4, 'Paket 1 no 14', 'SOAL-08072020215603-89Kei.png', '<p>Berdasarkan gambar diatas, nama angin dan penjelasan yang tepat adalah...</p>', 'A', 5, '2'),
(338, 1, 10, 2, 4, 'Paket 1 no 18', 'SOAL-08072020215720-z2Rry.png', '<p>Perhatikan gambar siklus hidrologi diatas!</p>\r\n\r\n<p>Angka 6 pada gambar menunjukkan proses...</p>', 'D', 5, '2'),
(339, 1, 10, 2, 4, 'Paket 1 no 19', 'SOAL-08072020215813-1qSxj.png', '<p>Pola aliran sungai yang terdapat pada gambar dapat ditemukan di daerah dengan kondisi morfologi...</p>', 'D', 5, '2'),
(340, 1, 10, 2, 4, 'Paket 1 no 22', 'SOAL-08072020215909-PViPn.png', '<p>Perhatikan gambar diatas!</p>\r\n\r\n<p>Fauna khas yang terdapat pada wilayah bertanda X adalah...</p>', 'A', 5, '2'),
(341, 1, 10, 2, 4, 'Paket 1 no 23', 'SOAL-08072020220011-B0hZf.png', '<p>Taman Nasional yang terletak pada lokasi X adalah...</p>', 'A', 5, '2'),
(342, 1, 10, 2, 4, 'Paket 1 no 25', 'SOAL-08072020220120-q4cCn.png', '<p>Pada gambar berikut ini, lokasi penambangan batu intan terbesar di Indonesia\r\nditunjukkan oleh huruf...</p>', 'D', 5, '2'),
(343, 1, 10, 2, 4, 'Paket 1 no 28', 'SOAL-08072020220214-unbga.png', '<p>Usaha pemerintah yang perlu dilakukan untuk mengakomodasi kondisi\r\nkependudukan seperti gambar di bawah ini adalah...</p>', 'B', 5, '2'),
(344, 1, 10, 2, 4, 'Paket 1 no 35', 'SOAL-08072020220405-iVbBj.png', '<p>Perhatikan dua gambar atas!</p>\r\n\r\n<p>Kesimpulan yang tepat mengenai kedua gambar tersebut adalah...</p>', 'B', 5, '2'),
(345, 1, 10, 2, 4, 'Paket 1 no 37', 'SOAL-08072020220556-uZsR9.png', '<p>Berdasarkan gambar tersebut, titik Z berada pada ketinggian...</p>', 'C', 5, '2'),
(346, 1, 10, 2, 4, 'Paket 1 no 44', 'SOAL-08072020220644-Ew9c0.png', '<p>Berdasarkan gambar di bawah ini, lokasi yang tepat untuk membangun pusat perbelanjaan adalah...</p>', 'B', 5, '2'),
(347, 1, 10, 2, 4, 'Paket 1 no 50', 'SOAL-08072020220736-47Y6Q.png', '<p>Sebutkan berada di benua manakah negara berkembang tersebut (X, Y, Z), serta\r\nnama negaranya secara berurutan adalah...</p>', 'B', 5, '2');
INSERT INTO `beritas` (`id`, `title`, `description`, `content`, `is_cover`, `status_berita`, `created_at`, `updated_at`) VALUES
(1, 'Universitas Indonesia Buka Kuota 3.769 Mahasiswa Baru Jalur SIMAK UI', 'Universitas Indonesia (UI) menyediakan 3.769 kursi bagi mahasiswa baru jenjang Vokasi, S1 Reguler dan S1 Paralel melalui jalur masuk ujian tulis SIMAK UI. \r\nHal tersebut disampaikan UI melalui keterangan tertulis di laman resmi universitas.', '<p>Universitas Indonesia (UI) menyediakan 3.769 kursi bagi mahasiswa baru jenjang Vokasi, S1 Reguler dan S1 Paralel melalui jalur masuk ujian tulis SIMAK UI.</p>\r\n\r\n<p>Hal tersebut disampaikan UI melalui keterangan tertulis di laman resmi universitas.</p>\r\n\r\n<p>&quot;Bagi lulusan SMA/Sederajat yang tertarik dengan bidang kejuruan dapat mendaftar di program Pendidikan Vokasi.</p>\r\n\r\n<p>Sedangkan bagi yang tertarik dengan bidang keilmuan dapat mendaftar di program S1 Reguler dan S1 Paralel,&quot; tulis keterangan tersebut seperti dilansir Kompas.com, Rabu (1/7/2020).</p>\r\n\r\n<p>Pendaftaran SIMAK UI untuk jalur Vokasi, S1 Reguler dan S1 paralel telah dibuka mulai 19 Juni 2020 hingga 19 Juli 2020.</p>\r\n\r\n<p>Untuk jadwal ujian, ujian SIMAK UI untuk jalur Vokasi, S1 Reguler dan S1 paralel akan dilakukan pada tanggal 5 Agustus 2020 dan pengumuman pada tanggal 22 Agustus 2020.</p>\r\n\r\n<p>&quot;Halo calon mahasiswa UI, kami informasikan update jadwal SIMAK UI untuk program S1 Reguler/ S1 Paralel/ D3 Vokasi, bahwa tanggal ujian SIMAK UI diundur menjadi 5 Agustus 2020 dan pengumuman kelulusan menjadi 22 Agustus 2020,&quot; tulis laman Instagram UI.</p>\r\n\r\n<p>Bila tertarik untuk masuk UI melalui jalur ini, segera lakukan pendaftaran sebelum 19 Juli 2020 pukul 23.59 WIB.</p>\r\n\r\n<p>Informasi lengkap dan pendaftaran SIMAK UI untuk ketiga program tersebut dapat dilakukan melalui laman penerimaan.ui.ac.id.</p>\r\n\r\n<p><br />\r\nPeserta KIP Kuliah juga dapat mendaftar jalur SIMAK UI. Berikut alur pendaftaran SIMAK UI untuk pemegang kartu KIP Kuliah:</p>\r\n\r\n<ol>\r\n	<li>Membuat akun di laman penerimaan.ui.ac.id Login dengan akun yang sudah dibuat.</li>\r\n	<li>Melengkapi isian pada menu KIP Kuliah (mulai tanggal 25 Juni 2020).</li>\r\n	<li>Menunggu hasil verifikasi.</li>\r\n	<li>Setelah diverifikasi, peserta dapat melanjutkan pengisian formulir pendaftaran dan memilih program studi pada menu Buat Pendaftaran.</li>\r\n	<li>Peserta yang lolos verifikasi KIP Kuliah tidak perlu membayar biaya pendaftaran.</li>\r\n</ol>\r\n\r\n<p>Keterangan:</p>\r\n\r\n<ul>\r\n	<li>Peserta KIP Kuliah hanya dapat memilih jalur S1 Reguler dengan maksimal pilihan 3 program studi.</li>\r\n	<li>Setelah diterima di Universitas Indonesia pada Program S1 Kelas Reguler, calon mahasiswa yang terdaftar sebagai peserta KIP-Kuliah wajib mengumpulkan berkas kelengkapan tambahan sebagi proses seleksi penerima KIP Kuliah di UI. Berkas kelengkapan tersebut akan diinformasikan pada saat pengumuman hasil seleksi. lalu mengunggah foto kartu KIP Kuliah untuk verifikasi sebagai peserta KIP Kuliah.</li>\r\n</ul>', 'BRT-01-07-2020-12-41-33.jpg', 'PUBLIC', '2020-07-01 05:41:33', '2020-07-01 05:41:33'),
(2, 'H-4 Tes UTBK-SBMPTN 2020 Tahap I, Ini Info Penting dari LTMPT', 'Pelaksanaan Ujian Tulis Berbasis Komputer (UTBK) untuk Seleksi Bersama Masuk Perguruan Tinggi Negeri (SBMPTN) 2020 gelombang pertama (tahap I) akan berlangsung 5-14 Juli 2020.', '<p>Pelaksanaan Ujian Tulis Berbasis Komputer (UTBK) untuk Seleksi Bersama Masuk Perguruan Tinggi Negeri (SBMPTN) 2020 gelombang pertama (tahap I) akan berlangsung 5-14 Juli 2020.</p>\r\n\r\n<p>Artinya, calon mahasiswa yang mendapatkan jadwal untuk tes UTBK pada tahap I hanya memiliki waktu persiapan 4 hari sebelum hari H pelaksanaan tes UTBK 2020.</p>\r\n\r\n<p>Terkait dengan pelaksanaan UTBK yang semakin dekat, Lembaga Tes Masuk Perguruan Tinggi ( LTMPT) menyampaikan sejumlah informasi penting terkait proses cetak ulang Kartu Peserta UTBK 2020.</p>\r\n\r\n<p>&quot;Hallo, Calon Mahasiswa Indonesia! Ada informasi yang tidak kalah penting terkait proses cetak ulang Kartu Peserta UTBK 2020.</p>\r\n\r\n<p>Perhatikan dengan seksama untuk tempat dan waktu pelaksanaan tesnya, ya. Dan jika ada kendala, Calon Mahasiswa dapat langsung menghubungi Pusat UTBK PTN tempat tes peserta. Tetap semangat dan jaga kesehatan!&quot; tulis LTMPT melalui akun Instagram, Selasa (30/6/2020).</p>\r\n\r\n<p>Berikut 3 (tiga) info dari LTMPT yang perlu diperhatikan oleh peserta UTBK-SBMTPN 2020</p>\r\n\r\n<p><strong>1. Pastikan untuk cetak ulang kartu</strong><br />\r\nPastikan Anda sudah mencetak ulang Kartu Tanda Peserta UTBK, dengan cara login di laman http://portal.ltmpt.ac.id, pada Menu Pendaftaran UTBK-SBMPTN.</p>\r\n\r\n<p><strong>2. Pahami jadwal dan tempat ujian</strong><br />\r\nPastikan Anda sudah mencermati dan memahami Jadwal dan Tempat Tes UTBK, sesuai yang tercetak pada Kartu Tanda Peserta yang baru.</p>\r\n\r\n<p><strong>3. Hubungi Pusat UTBK bila ada kendala</strong><br />\r\nJika Anda tidak dapat mengikuti tes sesuai jadwal, karena tidak memenuhi persyaratan Satgas Covid-19 Daerah, silakan menghubungi Pusat UTBK PTN tempat tes (lihat alamat Pusat UTBK di laman http://portal. ltmpt.ac.id/?mid=15).</p>\r\n\r\n<p><strong>Jadwal UTBK 2020</strong><br />\r\n<strong>1. Tes UTBK bakal dilaksanakan dua tahap, yakni:</strong></p>\r\n\r\n<ul>\r\n	<li>Tahap I: 5-14 Juli 2020</li>\r\n	<li>Tahap II: 20-29 Juli 2020</li>\r\n	<li>Pengumuman SBMPTN: 20 Agustus 2020</li>\r\n</ul>\r\n\r\n<p><strong>2. Pelaksanaan Tes UTBK per hari diubah dari empat sesi menjadi dua sesi, dengan rincian: </strong></p>\r\n\r\n<ul>\r\n	<li>Sesi 1 pukul 09.00-11.15 waktu setempat</li>\r\n	<li>Sesi 2 pukul 14.00-16.15 waktu setempat</li>\r\n	<li>Jeda waktu selama 2 jam 45 menit digunakan untuk pelaksanaan protokol kesehatan saat pergantian sesi.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 'BRT-01-07-2020-12-51-59.jpg', 'PUBLIC', '2020-07-01 05:51:59', '2020-07-01 05:51:59'),
(3, 'PPDB di Cilacap Tanpa Kuota Khusus Anak Nakes, Ini Solusi Disdik', 'Pemerintah Provinsi Jawa Tengah memberikan kuota khusus untuk anak tenaga kesehatan yang menangani pasien COVID-19 dalam Penerimaan Peserta Didik Baru (PPDB) tahun 2020', '<p>Pemerintah Provinsi Jawa Tengah memberikan kuota khusus untuk anak tenaga kesehatan yang menangani pasien COVID-19&nbsp;dalam Penerimaan Peserta Didik Baru (PPDB) tahun 2020.</p>\r\n\r\n<p>Melalui jalur afirmasi, anak-anak tenaga kesehatan mendapat prioritas saat mendaftar di sekolah yang dipilih. Kebijakan ini sebagai penghargaan terhadap tenaga kesehatan yang menjadi garda terdepan penanganan pasien COVID-19.</p>\r\n\r\n<p>Namun, Dinas Pendidikan Kabupaten Cilacap tidak memberlakukan jalur khusus tenaga kesehatan pada PPDB jenjang SD dan SMP. Sebab, mereka berkaca pada&nbsp;PPDB&nbsp;jenjang SMA yang menuai persoalan setelah menerapkan kuota khusus untuk anak tenaga kesehatan.</p>\r\n\r\n<p>&quot;Yang menangani Covid-19 kan bukan hanya nakes, ada polisi, tentara, di kecamatan ada satgas hingga desa,&quot; kata Kepala Bidang Pendidikan Dasar Dinas Pendidikan Kabupaten Cilacap, Kastam, melalui sambungan telepon.</p>\r\n\r\n<p>Jika PPDB SMP di Cilacap hanya memberikan prioritas kepada anak tenaga kesehatan atau nakes, maka hal ini akan memicu protes dari orangtua dari profesi lain yang turut menangani Covid-19.</p>\r\n\r\n<p>Sementara jika semua diberi kesempatan pada jalur afirmasi, maka akan menggeser kuota afirmasi untuk anak dari keluarga tidak mampu dalam&nbsp;PPDB&nbsp;Cilacap.</p>\r\n\r\n<p>Sumber : <a href=\"https://www.liputan6.com/regional/read/4298144/ppdb-di-cilacap-tanpa-kuota-khusus-anak-nakes-ini-solusi-disdik\">Liputan 6</a></p>', 'BRT-07-07-2020-22-42-48.jpg', 'PUBLIC', '2020-07-07 15:42:48', '2020-07-07 15:42:48');
