(36, 44, 'A', 'Aku tak kerasan kalau kita bertemu lagi, gadis mungil yang malang. Senyumanmu tak hiraukan duka lara. Kau berharap pada mereka di kota yang tanpa jiwa. Kelak, jika engkau tiada, harapan itu siapa pemiliknya? Lalu kotaku, tak ada lagi kabar.'),
(37, 44, 'B', 'Aku bertemu penjual kaleng yang berusia mungil. Aku merasa kasihan lalu memberinya kaleng kecil yang lebih bagus dari miliknya. Tiba-tiba gadis itu tersenyum padaku dan kuberikan amplop sebagai uang jajan.'),
(38, 44, 'C', 'Anak kecil meninggal karena kaleng kecil yang dirampas oleh preman. Anak kecil itu tak terima jika kaleng kesayangannya hilang atau berpindah tangan. Akhirnya, dia pun pulang saat matahari mulai terbenam.'),
(39, 44, 'D', 'Gadis kecil penjual kaleng selalu datang ke rumahku. Aku tidak mau orang tua khawatir. Mereka sempat tengadah padaku, memakan jambu merah yang nikmat. Tak pernah dia merasakan nikmat yang sehebat itu.'),
(40, 44, 'E', 'Aku mengalami kecelakaan dan seketika koma. Sebelumnya, ia mencoba menyelamatkan gadis kecil yang membawa kaleng. Entah untuk apa kaleng itu digunakan. Aku pun tak mengerti karunia apa yang menimpaku.'),
